import axios from "axios";
import { useState } from "react";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Nav from "./Nav";

const Viewusers = () => {
  const nav = useNavigate();
  const [data, setData] = useState([]);
  const [value, setvalue] = useState([]);
  useEffect(() => {
    axios.post("http://localhost:5000/food/viewusers").then((response) => {
      setData(response.data);
      setvalue(response.data);
    });
  }, []);
  const viewusers = (e) => {
    nav("/updateusers", { state: e });
  };
  const deletec = (e) => {
    axios
      .post("http://localhost:5000/food/deleteusers", { id: e })
      .then((response) => {
        axios.post("http://localhost:5000/food/viewusers").then((response) => {
          setData(response.data);
          setvalue(response.data);
        });
      });
  };
  const searchdata = (e) => {
    const r = [];

    for (var k of value) {
      var v = 0;

      for (var n of k) {
        n = "" + n;
        if (n.toLowerCase().indexOf(e) !== -1) {
          v = 1;
          break;
        }
      }
      if (v === 1) {
        r.push(k);
      }
    }
    setData(r);
  };

  return (
    <div>
      <Nav />
      <h3>users</h3>
      <input
        type="search"
        onChange={(e) => searchdata(e.target.value)}
        className="form-select"
        placeholder="Search"
      />
      <div className="table-responsive">
        <table className="table table-bordered" id="table_id">
          <thead>
            <tr>
              <th>uid</th>
              <th>fname</th>
              <th>mobile</th>
              <th>blockchainaddress</th>
              <th>privatekey</th>
              <th>role</th>
              <th>approved</th>
            </tr>
          </thead>
          <tbody>
            {data.map((d) => {
              return (
                <tr key={d[0]}>
                  <td>
                    <button
                      className="btn btn-primary"
                      onClick={() => viewusers(d)}
                    >
                      {d[0]}
                    </button>
                  </td>
                  <td>{d[1]}</td>
                  <td>{d[2]}</td>
                  <td>{d[3]}</td>
                  <td>{d[4]}</td>
                  <td>{d[5]}</td>
                  <td>
                    {d[6] === 0 ? (
                      <button
                        className="btn btn-success"
                        onClick={() => {
                          axios
                            .post("http://localhost:5000/food/approveusers", {
                              uid: d[0],
                            })
                            .then((response) => {
                              axios
                                .post("http://localhost:5000/food/viewusers")
                                .then((response) => {
                                  setData(response.data);
                                  setvalue(response.data);
                                });
                            });
                        }}
                      >
                        Approve
                      </button>
                    ) : (
                      "Approved"
                    )}
                  </td>
                  <td>
                    <button
                      className="btn btn-primary"
                      onClick={() => deletec(d[0])}
                    >
                      delete
                    </button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};
export default Viewusers;
